import React from "react";
import {
  SearchOutlined,
  MenuUnfoldOutlined,
  BellOutlined,
} from "@ant-design/icons";
import Search from './asserts/search'
import Notification from "./asserts/notification";
import { Tag, Button, Breadcrumb, Divider } from "antd";
import {
  Navbar,
  NavTool,
  LeftHead,
  Heading,
  OrgName,
  MenuFold,
  NameCard,
  ReviewHeaderName,
  ReviewHeaderAdmin,
  SearchBtn,
} from "./navBarStyles";
function ReviewHeader ()  {
  return (
    <Navbar className="reviewNavbar">
      <LeftHead>
        <MenuFold>
          <MenuUnfoldOutlined />
        </MenuFold>
        <Heading>
          <OrgName>Profile</OrgName>

        </Heading>
      </LeftHead>
      <NavTool>
        <SearchBtn id="searchBtn" shape="circle" icon={<Search />} />


          <Button className="helpBtn">Help</Button>

        <div className="headTool">
         <Notification style={{fill: 'var(--grey-t-92, #F0F2F4)'}}/>
        </div>
        <Divider type="vertical" />
        <NameCard>R</NameCard>
        <div>
          <div>
            <ReviewHeaderName className="myName">Renuka</ReviewHeaderName>
          </div>
          <ReviewHeaderAdmin className="admin">
           User
          </ReviewHeaderAdmin>
        </div>
      </NavTool>
    </Navbar>
  );
};
export default ReviewHeader;
